      strncpy (loader_fname, p ? p : "loader.bin", FILENAME_MAX)[FILENAME_MAX - 1] = 0;

      if (ucon64_fread (loader, 0, LOADER_SIZE, loader_fname) <= 0)
        {
          fprintf (stderr, "ERROR: Could not load loader binary (%s)\n", loader_fname);
          return -1;
        }
